description:
This is not Rodney&amp;#039;s best.  If you are already into Yoga you may find he uses far too many supports (chairs, blocks, etc.) for you.  That said, it&amp;#039;s still very good relative to all the other Yoga stuff out there.

Rodney has a posse in this one which is a departure.  Production value is top-notch.  I dunno&amp;#039;, you decide if it&amp;#039;s worthwhile and post a follow-up.

